import logo from './logo.svg';
import React, { Component } from 'react'
import './App.css';


class ItemProjectEntrepreneur extends Component {
    render() {
         {
            var image = this.props.data.image,
                url = this.props.url,
                title = this.props.data.nom,
                entrepreneur = this.props.data.entrepreneur;
            return (
                <figure className="snip1584">
                    <img className="picProjectEntrepreneur" src={url+image+`.jpg`} alt="test" />
                    <figcaption>
                        <h3>{title}</h3>
                        <h5>{entrepreneur}</h5>
                    </figcaption><a href="#"></a>
                </figure>
            )
        }
    }
  }

export default ItemProjectEntrepreneur;
